import React from "react";
import Navbar from "./Components/Navbar";
import Services from "./Components/Services";
import BrowseRouter from "react-router-dom";

function App() {
  return (
    <React.Fragment>
      <Navbar />
      <Router>
        <Routes>
          <Route exact path="/services" element={<Services />} />
        </Routes>
      </Router>
    </React.Fragment>
  );
}

export default App;
